import { Link } from 'react-router-dom';
import "../styles/HomePage.css";

function HomePage() {
    return (
        <div>
            <div className="links">
                <a href='/products' className="catalogButton">Каталог</a>
            </div>
        </div>
    );
}

export default HomePage;
